import React from 'react';

function Authors(){
    return(
        <div>
        <table className="table table-striped table-bordered table-sm tinymask ">
          <thead className="thead-dark">
            <tr>
              <th>ID</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Email</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
          </tbody>
        </table>
        <center><a href className="btn btn-primary">Add New Record</a></center>
      </div>
    );
}

export default Authors;
